import './book-slider.css';
const BookSilder=({data})=>{
    return(
    <div className="book-slider-container">
      <i className="bi bi-chevron-left "></i>
        <div className="book-slider-wrapper">
            {data.map( item=>
            <div className="book-slide-item">
               <img src={item.image} alt={item.title} className='book-slide-item-img'/>
               <h3 className="book-slide-item-title"></h3>
            </div>
            )}
        </div>
      <i className="bi bi-chevron-right "></i>
    </div>
    
    );
}

export default BookSilder;
